use lcsm::*;

#[test]
fn two_lcsm() {
    let dataset = r#">Rosalind_1
GATTACA
>Rosalind_2
TAGACCA
>Rosalind_3
ATACA"#;

    assert_eq!(lcsm(dataset), "TA");
}

